import { event } from 'jquery';
import { useState } from 'react';
import Button from '../../atoms/Button'
import Icon from '../../atoms/Icon'
const [eve,setEve] = useState('')
console.log(eve)
const InputArea = ()=> {
    const iconText = 'bx bx-search-alt';
    return (
        <div className = "input-area-wrap">
            <div className = "input-area">
                <input  type="text" placeholder="searchMobiles" onChange={(e)=>{
                        setEve(e)
                }}  />
            </div>
            <div className="input-button-icon">
                <Button classText="input-button" buttonText={<Icon classText={iconText}/>}/>
            </div>
        </div>
    )
}

export default InputArea
